import React, { useState, useEffect } from 'react'

function Random ({ info }) {
    let randomNumber=Math.floor(Math.random() * 10)
    let randomCard= info.filter(card => card.id===randomNumber)
    console.log(randomCard)

    return (
        <div>
            <h3 key={randomCard.jargon}>{randomCard.jargon}</h3>
            <p key={randomCard.definition}>{randomCard.definition}</p>
            <p key={randomCard.sentence}>{randomCard.sentence}</p>
            <iframe key={randomCard.image} src={randomCard.image} height='240' width='240' frameBorder='0'></iframe>
        </div>
    )    
}

export default Random
